import React from 'react';
import {Link} from "react-router-dom"
function NavbarDropdown({isOpen,toggle}) {
    return (
        <div className={isOpen ? "grid grid-rows-4 text-center items-center bg-yellow-300" : "hidden"}>
                <Link to="/" className="p-4">Home</Link>
                <Link to="/about" className="p-4">About us</Link>
                <Link to="/contact" className="p-4">Contact</Link>
        </div>
    )
}

export default NavbarDropdown
